import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Navbar from './Navbar';
import axios from 'axios';
import { format } from 'date-fns';

const AdminDashboard = () => {
  const [eventRegistrations, setEventRegistrations] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('events');

  useEffect(() => {
    fetchEventRegistrations();
  }, []);

  const fetchEventRegistrations = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('/api/admin/event-registrations', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setEventRegistrations(response.data);
      setError('');
    } catch (err) {
      console.error('Error fetching registrations:', err);
      setError('Failed to load event registrations');
    } finally {
      setLoading(false);
    }
  };

  const EventRegistrationsTable = () => (
    <div className="bg-white rounded-lg shadow-md p-6">
      <h2 className="text-2xl font-semibold mb-6">Event Registrations</h2>
      {loading ? (
        <div className="text-center">Loading...</div>
      ) : error ? (
        <div className="text-red-600">{error}</div>
      ) : eventRegistrations.length === 0 ? (
        <div className="text-gray-500">No registrations found</div>
      ) : (
        eventRegistrations.map(({ event, registrations }) => (
          <div key={event.id} className="mb-8">
            <h3 className="text-xl font-semibold mb-4">
              {event.title} - {format(new Date(event.date), 'PPP')}
            </h3>
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      User
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Email
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Registration Date
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Status
                    </th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {registrations.map((user) => (
                    <tr key={`${event.id}-${user.id}`}>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="text-sm font-medium text-gray-900">
                          {user.full_name}
                        </div>
                        <div className="text-sm text-gray-500">
                          {user.username}
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        {user.email}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        {format(new Date(user.registration_date), 'PPp')}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${
                          user.status === 'confirmed' 
                            ? 'bg-green-100 text-green-800'
                            : 'bg-yellow-100 text-yellow-800'
                        }`}>
                          {user.status}
                        </span>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        ))
      )}
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar />
      <div className="container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold mb-8">Admin Dashboard</h1>
        
        <div className="flex space-x-4 mb-6">
          <button
            onClick={() => setActiveTab('events')}
            className={`px-4 py-2 rounded ${
              activeTab === 'events'
                ? 'bg-forest text-white'
                : 'bg-gray-200 text-gray-700'
            }`}
          >
            Events
          </button>
          <button
            onClick={() => setActiveTab('users')}
            className={`px-4 py-2 rounded ${
              activeTab === 'users'
                ? 'bg-forest text-white'
                : 'bg-gray-200 text-gray-700'
            }`}
          >
            User Management
          </button>
        </div>

        {activeTab === 'events' ? (
          <EventRegistrationsTable />
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {/* Event Management Card */}
            <Link to="/admin/events" className="block">
              <div className="bg-white rounded-lg shadow-md p-6 hover:shadow-lg transition-shadow">
                <h2 className="text-xl font-semibold mb-2">Event Management</h2>
                <p className="text-gray-600">Create and manage events</p>
              </div>
            </Link>

            {/* Analytics Card */}
            <div className="bg-white rounded-lg shadow-md p-6">
              <h2 className="text-xl font-semibold mb-2">Analytics</h2>
              <p className="text-gray-600">View system analytics and statistics</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
